import React from "react";
import Navbar from "../Components/navbar";
import Footer from "../Components/footer";

const EducationAndTrainings = () => {
    const education = [
        {
            degree: "Bachelor of Engineering in Computer Science",
            institution: "Thapathali Campus, Tribhuvan University",
            year: "2020 - Present",
            description: "Focused on software development, data structures, algorithms, and system design.",
        },
        {
            degree: "High School (+2) in Science",
            institution: "National School of Sciences (NIST)",
            year: "2018 - 2020",
            description: "Specialized in physics, chemistry, and mathematics.",
        },
    ];

    const trainings = [
        {
            title: "Full-Stack Web Development Bootcamp",
            organization: "Udemy",
            year: "2023",
            description: "Comprehensive training on MERN stack development including React.js, Node.js, and MongoDB.",
        },
        {
            title: "Data Structures and Algorithms",
            organization: "Coursera",
            year: "2022",
            description: "In-depth study of problem-solving techniques and algorithm optimization.",
        },
        {
            title: "Leadership and Team Building Workshop",
            organization: "Orbit Engineering Expo",
            year: "2022",
            description: "Developed leadership, project management, and collaborative skills.",
        },
    ];

    return (
        <>
            <Navbar />
            <div className="bg-gray-50 dark:bg-gray-900 py-16 min-h-screen">
                <div className="max-w-6xl mx-auto px-6 lg:px-8">
                    {/* Header Section */}
                    <div className="text-center mb-12">
                        <h1 className="text-5xl font-bold text-gray-800 dark:text-white">
                            Education & Trainings
                        </h1>
                        <p className="mt-4 text-lg text-gray-600 dark:text-gray-300">
                            A summary of my academic background and professional development programs.
                        </p>
                    </div>

                    {/* Education Section */}
                    <div className="mb-16">
                        <h2 className="text-3xl font-semibold text-gray-800 dark:text-white mb-6">
                            Education
                        </h2>
                        <div className="space-y-6">
                            {education.map((edu, index) => (
                                <div
                                    key={index}
                                    className="bg-white dark:bg-gray-800 rounded-lg shadow-md p-6"
                                >
                                    <h3 className="text-2xl font-semibold text-gray-800 dark:text-white mb-2">
                                        {edu.degree}
                                    </h3>
                                    <p className="text-gray-600 dark:text-gray-300">
                                        {edu.institution} <span>({edu.year})</span>
                                    </p>
                                    <p className="mt-2 text-gray-600 dark:text-gray-300">
                                        {edu.description}
                                    </p>
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Trainings Section */}
                    <div>
                        <h2 className="text-3xl font-semibold text-gray-800 dark:text-white mb-6">
                            Trainings & Certifications
                        </h2>
                        <div className="space-y-6">
                            {trainings.map((training, index) => (
                                <div
                                    key={index}
                                    className="bg-white dark:bg-gray-800 rounded-lg shadow-md p-6"
                                >
                                    <h3 className="text-2xl font-semibold text-gray-800 dark:text-white mb-2">
                                        {training.title}
                                    </h3>
                                    <p className="text-gray-600 dark:text-gray-300">
                                        {training.organization} <span>({training.year})</span>
                                    </p>
                                    <p className="mt-2 text-gray-600 dark:text-gray-300">
                                        {training.description}
                                    </p>
                                </div>
                            ))}
                        </div>
                    </div>
                </div>
            </div>
            <Footer />
        </>
    );
};

export default EducationAndTrainings;
